import React from 'react';
import logo from './logo.svg';
import './App.css';
import { TextField, Button, AppBar, Toolbar, Typography, Link } from '@mui/material/';

function App() {
  return (
    <div>

      <div>

        {/* # THE HEADER BAR */}
        <AppBar>


          <div className="header">
            <h1 className="leftPadding">Fast Meals</h1>
            <div className="links rightPadding">
            <Button color="inherit">Macros Information</Button>
            <Button color="inherit">Calculator</Button>
            </div>
          </div>


      </AppBar>
      </div>

      <div className='center height'>
        <br></br>
        <h1>Calculate the calories in your meal</h1>
        </div>

      <div className='center'>
        <TextField id="outlined-basic" label="Protein (g)" variant="outlined" />

        <TextField id="outlined-basic" label="Carbs (g)" variant="outlined" />

        <TextField id="outlined-basic" label="Fat (g)" variant="outlined" />

      </div>

      <div>
      <Button className="center" variant="contained">Contained</Button>
      </div>

    </div>


  );
}

export default App;
